import { Component, OnInit } from '@angular/core';
import { FileSystemPlugin, FileSystemPluginDirectory } from 'src/core-native';

const toBase64 = (file: any) => new Promise((resolve, reject) => {
  const reader = new FileReader();
  reader.readAsDataURL(file);
  reader.onload = () => resolve(reader.result);
  reader.onerror = error => reject(error);
});

@Component({
  selector: 'app-file-system',
  templateUrl: './file-system.page.html',
  styleUrls: ['./file-system.page.scss'],
})
export class FileSystemPage {
  
  constructor(public fileSystem: FileSystemPlugin) { }
  
  results: any = {}

  

  deleteFile(){
    const fileName = 'factura.pdf';
    const fileType = 'pdf';
    this.fileSystem.deleteFile({ fileName, path: '', directory: FileSystemPluginDirectory.Cache }).then(result => {
      this.results = result;
    });
  }
  fileExist(){
    const fileName = 'factura.pdf';
    const fileType = 'pdf';
    this.fileSystem.fileExists({ fileName, path: '', directory: FileSystemPluginDirectory.Cache }).then(result => {
      this.results = result;
    });
  }

  openfile(){
    const fileName = 'factura.pdf';
    const fileType = 'pdf';
    // const data = toBase64('/assets/fatura.pdf');

    // console.log(this.file);

    
    // const result =  this.fileSystem.writeFile({ fileName, fileType, data: this.file });
    this.fileSystem.writeFile({ fileName, fileType: 'pdf', path: '', directory: FileSystemPluginDirectory.Cache, data: this.file, recursive: true }).then(result => {
      if (result.status) {
        this.fileSystem.openfile({ fileName, fileType, path: '', directory: FileSystemPluginDirectory.Cache, fullPath: result.value });
      }
    });
  }

  get file(): string { return ''; } 

}
